import React, { Component } from 'react';

class Results extends Component {
   constructor(props) {
      super(props);
      this.state = {
         testResults: []
      }
      this.setResults = this.setResults.bind(this);
   }

   setResults() {
      this.setState({
         testResults: this.props.testResults
      });
   };

   render() {
      console.log(this.props.testResults[0].hertz[3].hzLevel);
      return (
         <main>
            <p className="ml-4">Results</p>
         </main>
      );
   }
}

export default Results;
